        private async void bAdd_Click(object sender, RoutedEventArgs e)
        {
            string txt = tbAdd.Text;



            if (stockListID.Contains(txt))
            {
                foreach (CheckBox cb_it in checkboxPanel.Children)
                {
                    if (cb_it.Content.ToString().IndexOf(txt) > -1)
                    {
                        cb_it.IsChecked = true;
                        tbAdd.Text = "";
                        return;
                    }
                }
                int element = stockListID.IndexOf(txt);
                var cb = new CheckBox { Content = stockListName[element] + " (" + stockListID[element] + ")", Foreground = new SolidColorBrush(Colors.White)    };
                checkboxPanel.Children.Add(cb);
            }
            else tbAdd.Text = "";
        }

        private void bFinish_Click(object sender, RoutedEventArgs e)
        {
            string str = "";
            List<Stock> defaultStocks = new List<Stock>();

            foreach (UIElement ctrl in checkboxPanel.Children)
            {
                if (ctrl.GetType() == typeof(CheckBox))
                {
                    CheckBox cb = ((CheckBox)ctrl);
                    if (cb.IsChecked == true)
                    {
                        Stock newStock = new Stock((string) cb.Content);
                        defaultStocks.Add(newStock);
                        str += "ticket:" + newStock.getTicket() + ",name:" + newStock.getName() + ",h:0,l:0/";
                    }
                }
            }

            str = str.Remove(str.Length - 1, 1);

            mySettings.Values["stocks"] = str;

            User u = new User(defaultStocks);

            pushChannel = new SetupPush();
            pushChannel.Initialize();
            u.setAppUri(pushChannel.getUri());

            Frame.Navigate(typeof (Portfolio), u);
        }

        private async void enterHandler(object sender, KeyRoutedEventArgs e)
        {
                if (e.Key == Windows.System.VirtualKey.Enter)
                {
                    bAdd_Click(sender, e);
                }
        }
    }
